import React from 'react';
import { Button, Form, FormGroup, Label, Input } from 'reactstrap';
import {Link} from 'react-router-dom'
import '../App.css'

export default class LandingPage extends React.Component {
    constructor(props){
        super(props)
        this.state={
            name:'',
            title:'',
            content:''
        }
    }
    onChangeTitle(event){
        this.setState({
            title:event.target.value,
        })
    }
    onChangeContent(event){
        this.setState({
            content:event.target.value,
        })
    }
    submitRoziMantul(){
        fetch("https://reduxblog.herokuapp.com/api/posts?key=RoziMantul", {
            method: 'POST', // *GET, POST, PUT, DELETE, etc.
            mode: 'cors', // no-cors, cors, *same-origin
            cache: 'no-cache', // *default, no-cache, reload, force-cache, only-if-cached
            credentials: 'same-origin', // include, *same-origin, omit
            headers: {
                'Content-Type': 'application/json',
                // 'Content-Type': 'application/x-www-form-urlencoded',
            },
            redirect: 'follow', // manual, *follow, error
            referrer: 'no-referrer', // no-referrer, *client
            body: JSON.stringify({
                title: this.state.title,
                content: this.state.content
            }), // body data type must match "Content-Type" header
        })
        .then(response => response.json()) // parses JSON response into native JavaScript objects 
        .then(data => {
            console.log(data)
        })
    }

handleChangeName=(event)=>[
    this.setState({
        name: event.target.value
    })
]


    render(){


  return (
    <div  className='form-lp'>
<Form  inline>

        <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
          <Label for="examplePassword" className="mr-sm-2">Enter Your Name</Label>
          <Input onChange={this.handleChangeName} name="password" id="examplePassword" placeholder="don't tell!" />
        </FormGroup>
        <Link to={`/homepage/${this.state.name}`}>
        <Button>Submit</Button>
        </Link>
      </Form>  
      <br/>
      <Form  inline>

        <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
          <Label for="title" className="mr-sm-2">Title</Label>
          <Input onChange={this.handleChangeName} name="title"  placeholder="Title" />
        </FormGroup>

        <FormGroup className="mb-2 mr-sm-2 mb-sm-0">
          <Label for="content" className="mr-sm-2">Content</Label>
          <Input onChange={this.handleChangeName} name="content" placeholder="content" />
        </FormGroup>
        <Link to={`/homepage/${this.state.name}`}>
        <Button>Submit</Button>
        </Link>
      </Form>   

       </div>
  );
}
}
